import React, { Component } from 'react';
import Prism from "prismjs"
import { Grid, Paper, withStyles, List } from "@material-ui/core";

import '../../ReactJs/styles.css'
import Sidebar from '../sidebar';
import PrismCode from '../../ReactJs/prismCode';


const titles = { backgroundColor: '#F0F8FF', padding: '1px', fontSize: '16px' }

const styles = theme => ({
  paper: {
    margin: theme.spacing(1),
    padding: theme.spacing(1)
  },
  smMargin: {
    margin: theme.spacing(1)
  },
  actionDiv: {
    textAlign: "center"
  }
})

const deletes = `
var output = (function(x) {
 delete x;
 return x;
})(0);

console.log(output);
`.trim()

const objCreate = `
var Employee = {
  company: 'xyz'
}

var emp1 = Object.create(Employee);
console.log(emp1.company);

delete emp1.company
console.log('After', emp1.company);
 `.trim()

const code = `(function(){
  var a = b = 3;
 })();

 console.log("a defined? " + (typeof a !== 'undefined'));                                         //False
 console.log("b defined? " + (typeof b !== 'undefined'));                                         //True
 `.trim()

const code_2 = `function foo1(){
  return {
  bar: "hello"
  };
 }

 function foo2(){
  return
  {
  bar: "hello"
  };
 }

 console.log("foo1 returns:",foo1());
 console.log("foo2 returns:",foo2());`.trim()

const code_4 = `function sum(x, y) {
  if (y !== undefined) {
  return x + y;
  } else {
  return function(y) { return x + y; };
  }
 }

 console.log(sum(2,3));
 console.log(sum(2)(3));`.trim()

const code_5 = `var list = readHugeList();
var nextListItem = function() {
 var item = list.pop();

 if (item) {
 // process the list item...
 nextListItem();
 }
};`.trim()

const code_6 = `
//1
for (let i = 0; i < 3; i++) {
  setTimeout(() => {
    console.log(i);
  }, 1000);
}


//2
for (var i = 0; i < 3; i++) {
  setTimeout(() => {
    console.log(i);
  }, 1000);
}
`.trim()

const code_7 = `
var fruits = ["Banana", "Orange", "Apple", "Mango"];
fruits.splice(2, 0, "Lemon", "Kiwi");
console.log(fruits)`.trim()

const code_8 = `var a={},
b={key:'b'},
c={key:'c'};
  a[b]=123;
  a[c]=456;

console.log(a[b]);`.trim()

const code_9 = `console.log((function f(n){return ((n > 1) ? n * f(n-1) : n)})(10));`.trim()

const accidental = `
function foo() {
  let a = b = 0;
  a++;
  return a;
}

foo();
console.log(typeof a);
console.log(typeof b);


let a = b = 0;                               //declares a is local variable and b is global variable.
`.trim();

const arrlength = `
const clothes = ['jacket', 't-shirt'];
clothes.length = 0;

console.log(clothes[0]);                                           //undefined
`.trim();

const eyetest = `
const length = 4;
const numbers = [];
for (var i = 0; i < length; i++); {
  numbers.push(i + 1);
}

console.log(numbers);
`.trim();

const clousers = `
let i;
for (i = 0; i < 3; i++) {
  const log = () => {
    console.log(i);
  }
  setTimeout(log, 100);
}`.trim();

const happense = `
console.log(myVar);
console.log(myConst);

var myVar = 'value';
const myConst = 3.14;`.trim();

const code_16 = `
var myObject = {
  foo: "bar",
  func: function () {
    var self = this;
    console.log("outer func" + this.foo);
    console.log("outer func" + self.foo);

    (function () {
      console.log("inner func" + this.foo);
      console.log("inner func" + self.foo);
    }());
  }
};
myObject.func();
`.trim();

const CheckArr = `
var v1 = { name: "John", age: 18 };
var v2 = ["red", "green", "blue", "yellow"];

console.log(Array.isArray(v1));                                                                     // false
console.log(Array.isArray(v2));                                                                     // true
`.trim();



const commonEl = `
const arr = [1, 2, 3, 3, 2];
const count = {};

arr.forEach(el => {
  count[el] = count[el] ? (count[el] += 1) : 1
})

console.log(count)`.trim();

const hasOwnProperty = `
function unique(arr) {
  var count = {};
  return arr.filter((item) => {
    return count.hasOwnProperty(item) ? false : (count[item] = true);
  });
}

console.log(unique([2, 3, 4, 3, 2, 5]));`.trim();

const groupEl = `
var people = [
  { sex: "Male", name: "Jeff" },
  { sex: "Female", name: "Megan" },
  { sex: "Male", name: "Taylor" },
  { sex: "Female", name: "Madison" }
];

function groupBy(list, key) {
  return list.reduce((data, val) => {
    (data[val[key]] = data[val[key]] || []).push(val);
    return data;
  }, {});
};

var groupedPeople = groupBy(people, "sex");
console.log(groupedPeople.Male);
console.log(groupedPeople.Female);`.trim();

const duplicateEl = `
var arr = [1, 2, 3];
arr = arr.concat(arr);

console.log(arr)`.trim();



const removeEl = `
var arr = [1, 2, 3, 4, 5, 3]
var value = 2

arr = arr.filter((item) => {
  return item !== value
})

console.log(arr)`.trim();

const deletePro = `
var obj = {
  name: "Mukesh",
  Address: "India",
  pincode: 201306
};

delete obj.name;

console.log(obj);`.trim();

const specificEl = `
var arr = [1, 2, 3, 4, 5];

arr.splice(2, 0, 7);
console.log(arr.join());`.trim();

const Checking = `
const car = {
  color: 'blue'
}

obj = car.hasOwnProperty('color')
console.log(obj)`.trim();

const findOutput = `
console.log(1 + "2" + "2");
console.log(1 + +"2" + "2");
console.log(1 + -"1" + "2");
console.log(+"1" + "1" + "2");
console.log("A" - "B" + "2");
console.log("A" - "B" + 2);`.trim();

const findOutput2 = `
console.log("0 || 1 = "+(0 || 1));
console.log("1 || 2 = "+(1 || 2));
console.log("0 && 1 = "+(0 && 1));
console.log("1 && 2 = "+(1 && 2));
`.trim();

const findOutput3 = `
var x = 21;
var girl = function () {
  console.log(x);
  var x = 20;
};
girl();
`.trim();

const findOutput4 = `
console.log(1 < 2 < 3);
console.log(3 > 2 > 1);


The second returns false because of how the engine works regarding operator associativity for < and >. It compares 
left to right, so 3 > 2 > 1 JavaScript translates to true > 1. true has value 1, so it then compares 1 > 1, which 
is false.
`.trim();

const findOutput5 = `
var a = [1, 2, 3];
a[10] = 99;
console.log(a[6]);
`.trim();

const findOutput6 = `
console.log(typeof typeof 1);                                                     //string
console.log(typeof NaN);                                                          //number
`.trim();

const operator = `
console.log("~", ~3,~2+ "<>", 1<2>3 ,"==!", 3==!2 ,"!==", 3!==2)      //!==

console.log([] == [])                                                 //false
`.trim();

const logged = `
var a = ['dog', 'cat', 'hen'];
a[100] = 'fox';
console.log(a.length);                                            //101
`.trim();

const addOp = `
console.log(0 && hi)                                              //0
`.trim();

const vals = `
const x = 6 % 2;
const y = x ? 'One' : 'Two';
console.log(y)                                                    //Two
`.trim();

const running = `
function logThis() {
  console.log(this);                                              //window
}
logThis();
`.trim();

const thiscode = `
const foo = [1, 2, 3];
const [n] = foo;
console.log(n);                                                 //1s
`.trim();

const doesCode = `
const arr1 = [2, 4, 6];
const arr2 = [3, 5, 7];

console.log([...arr1, ...arr2]);                               //[2, 4, 6, 3, 5, 7]
`.trim();

const snippet = `
var a = Math.max() < Math.min();
var b = Math.max() > Math.min();
console.log(a)                                                  //true
console.log(b)                                                  //false

console.log(NaN === NaN)                                        //false
console.log(typeof(NaN))                                        //number
console.log(parseInt("123Hello"))                               //123
console.log(parseInt("Hello123"))                               //NaN
`.trim();

const outputs = `
const fun = ({ a, b, c }) => {
  console.log(a, b, c);
 };
 fun(0, 1, 2);                                        //undefined undefined undefined


 //
x = 3;
console.log(x);
var x;


//since the initialization of "x" is not hoisted.
var x;
console.log(x);                                         //undefined
x = 23;
`.trim();

const inside = `
var x = 0;
var y = 23;

if(x) { console.log(x) }   // The code inside this block will not run since the value of x is 0(Falsy)  
if(y) { console.log(y) }    // The code inside this block will run since the value of y is 23 (Truthy)
`.trim();

const argu = `
function add(...args){
  console.log(args)
}
add(12)

//2
console.log(typeof typeof 12)
console.log(typeof NaN)
`.trim();

const diffop = `
let arr=[{id:1, name:'Krishana'},{id:2, name:'Ram'}]
    function add(obj,index){
        obj[index].name = obj[index].name
        console.log('obj[index] ', obj[index].name)
        console.log('obj', obj)
    }
add(arr, 1)
console.log('arr', arr)
`.trim();

const actually = `
function fun({a,b,c}){
  console.log(a,b,c)
}
fun(1,2,3)
`.trim();

const frozen = `
let person = {
  name: "Leonardo",
  profession: {
      name: "developer"
  }
};
Object.freeze(person); // make object immutable
person.profession.name = "doctor";
console.log(person);


//With deep freeze
function deepFreeze(object) {
  let propNames = Object.getOwnPropertyNames(object);
  for (let name of propNames) {
      let value = object[name];
      object[name] = value && typeof value === "object" ?
          deepFreeze(value) : value;
  }
  return Object.freeze(object);
}
